import React from 'react';
import { Document, Page } from 'react-pdf';

function PDFReader({ pdf, setSelectedPdf }) {
  return (


<div className="pdf-reader">
      <button onClick={() => setSelectedPdf(null)} className="back-btn">
        Back to list
      </button>
      <h2>{pdf.title}</h2>
      <div className="pdf-viewer">
        <Document file={pdf.pdfUrl}>
          <Page pageNumber={1} />
        </Document>
      </div>
    </div>
  );
}

export default PDFReader;
